      this.xiangjinPrice[0].price = this.$store.state.yaoyiyao.money1
      this.xiangjinPrice[1].price = this.$store.state.yaoyiyao.money2
    },
    flag(){
      if(this.kaihongbaoLayer&&this.flag=='loading'){
        // this.utils.onPag('./pag/shake-loading.pag','shakeCan')
        return;
      }
      console.log('close 2')
      this.utils.hidePag('shakeCan')

      if(this.kaihongbaoLayer&&this.flag=='zhongjiang'){
        this.zhangjiangtime = 3
        this.zhangjiangtimer = setInterval(()=>{
          this.zhangjiangtime--;
          if(this.zhangjiangtime==0){
            clearInterval(this.zhangjiangtimer)
          }
        },1000)
      }
    },
    kaihongbaoLayer(){
      if(this.kaihongbaoLayer&&this.flag=='loading'){
        console.log('shake')
       return this.utils.onPag('./pag/shake-loading.pag','shakeCan')
      }
      console.log('close 2')
      this.utils.hidePag('shakeCan')

      if(this.kaihongbaoLayer&&this.flag=='zhongjiang'){
        this.zhangjiangtime = 3
        this.zhangjiangtimer = setInterval(()=>{
          this.zhangjiangtime--;
          if(this.zhangjiangtime==0){
            clearInterval(this.zhangjiangtimer)
          }
        },1000)
      }
    },

  },
  mounted() {
    // this.showRewardFn()
    this.$store.dispatch('yaoyiyaoUserInfo')
    this.getDayReward()

    //todo mock
    // this.$refs['MoneyNoTextLayer'].showModalFn(0.3)
  },
  beforeDestroy() {
    this.myShakeEvent.stop();
    window.removeEventListener('shake',this.yaoyiyaoCallback)
  },
  created() {
    this.initShake()
    const isAction = JSON.parse(localStorage.getItem('getAction'))
    var ua = navigator.userAgent.toLowerCase();
    if (ua.indexOf("like mac os x") > 0) {
      var reg = /os [\d._]*/gi;
      var verinfo = ua.match(reg);
      var version = (verinfo + "").replace(/[^0-9|_.]/ig, "").replace(/_/ig, ".");
      if (parseFloat(version) >= 13.3 && !isAction) {
        localStorage.setItem("getAction", true)
        this.isTip = true
      }
    }
  },
  methods: {
    // 初始化摇一摇
    initShake() {
      this.myShakeEvent = new Shake({
        threshold: 15, // 摇动阈值
        timeout: 500 // 事件发生频率，是可选值
      });
      this.myShakeEvent.start();
      window.addEventListener('shake', this.yaoyiyaoCallback);
    },

    // 摇一摇后的逻辑
    yaoyiyaoCallback() {
        let audio = this.$refs.envelopeComing2;
        if (window.navigator.vibrate) {
            navigator.vibrate(500);
        }
        audio.play()
        this.yaoyiyaoBtnFn()
    },
    //现金-提现
    goReward(){
      this.showDuihuanLayer = true
    },
    //立即提现
    goTixian(){
      this.$layer.msg('现金不足，先去摇红包攒现金吧～')
    },
    getDayReward(){
      this.$store.dispatch('yaoyiyaoDayReward')
    },
    closeDuihuanLayer(){
      this.showDuihuanLayer = false
      //插屏广告
      this.appParms ={
        mPlacementId: 'p638ef72486bc8',
        adType: 3
      }
      this.playVideoOrInsertAdFn()
    },
    closeMoneyNoTextLayer(){
      //插屏广告
      this.appParms ={
        mPlacementId: 'p638ef72486bc8',
        adType: 3
      }
      this.playVideoOrInsertAdFn()
    },
    closeOverTimeLayer(){
      this.showOverTimeLayer = false
      //插屏广告
      this.appParms ={
        mPlacementId: 'p638ef72486bc8',
        adType: 3
      }
      this.playVideoOrInsertAdFn()
    },
    closeActivityEndLayer(){
      this.activityEndLayer = false
      //插屏广告
      this.appParms ={
        mPlacementId: 'p638ef72486bc8',
        adType: 3
      }
      this.playVideoOrInsertAdFn()
    },
    openNewPackage(){
      this.activityEndLayer = false
      this.yaoyiyaoBtnFn()
    },
    // 播放视频或显示信息流方法
    playVideoOrInsertAdFn() {
      this.utils.webDataToApp('loadAd',this.appParms,()=>{
        this.onRewardVerify()
        this.onAdDismiss()
      })
    },
    goDayTixian(item){
      if(item.days==1){
        if(item.reward<0.3){
          this.$layer.msg('金额小于0.3,不支持微信提现')
        }else{
          this.utils.webDataToApp('setVxChatWithdrawal',{
            uid:this.$store.state.base_data.userId,
            product_id:this.$store.state.base_data.productId,
            withdraw_id:item.id,
            desc:''
          })
        }
      }else if(item.days==2||item.days==3){
        this.$store.commit('setRewardInfo',item.reward)
        this.$refs['MoneyTimeLayer'].showModalFn()
      }else{
        this.$store.dispatch('yaoyiyaoDayRewardSet')
        this.$refs['MoneyNoTextLayer'].showModalFn(item.money)
      }
    },
    ios13granted() {
      if (typeof DeviceMotionEvent.requestPermission === 'function') {
        DeviceMotionEvent.requestPermission().then(permissionState => {
          if (permissionState === 'granted') {
            this.initShake() //摇一摇
          } else if (permissionState === 'denied') {// 打开的链接不是https开头
            alert("当前IOS系统拒绝访问动作与方向。请退出微信，重新进入活动页面获取权限。或直接点击抽签桶参与活动")
          }
        }).catch((error) => {
          alert("请求设备方向或动作访问需要用户手势来提示")
        })
      } else {
        // 处理常规的非iOS 13+设备
        alert("处理常规的非iOS 13+设备")
      }
    },
    // 左侧中奖提示
    showRewardFn(){
      setInterval(()=>{
        if(!this.showRewardClass || this.showRewardClass === 'rewardAniamation2') {
          this.showRewardClass = 'rewardAniamation1'
        } else {
          this.showRewardClass = 'rewardAniamation2'
        }
      }, 2000);
    },
    // 点击摇一摇按钮事件
    yaoyiyaoBtnFn() {
       //判断是否超过十次
        if(this.$store.state.yaoyiyao.game_num>=10){
          this.showOverTimeLayer = true
          return;
        }
        this.kaihongbaoLayer = true
        this.flag = 'loading'

      let timer = setTimeout(async ()=> {
        this.$store.dispatch('yaoyiyaoShakeReward',{callback:()=>{
            if(this.$store.state.yaoyiyao.game_num==0){
              this.$refs['MoneyNoTextLayer'].showModalFn()
            }else{
              this.flag = 'zhongjiang'
            }
          }})
        clearTimeout(timer)
      }, 5000)
    },
    continueProgressModal(){
      this.kaihongbaoLayer = false
      this.yaoyiyaoBtnFn()
    },
    // 关闭中奖弹框
    closeZhongjianLayerFn() {
      this.kaihongbaoLayer = false
      this.flag = 'loading'
      this.appParms={
        mPlacementId: 'p638ef72486bc8',
        adType: 3
      }
      this.playVideoOrInsertAdFn()
    },
    //开奖
    openZhongjiangLayerFn(){
      if(this.zhangjiangtimer) clearInterval(this.zhangjiangtimer)
      console.log('~~~开奖啦~~~')
      this.kaihongbaoLayer = false
      this.appParms={
        mPlacementId:'p638ee4cd28b88',
        adType: 1
      }
      // 加载播放视频loading
      this.$refs['loadingVideoLayer'].showModalFn()

    },
    // 显示额外奖金弹框
   async showProgressModal() {
      //完成额外奖励任务
      if(this.$store.state.yaoyiyao.additional_num==this.$store.state.yaoyiyao.num){
        try{

          let resData = await homeApi.yaoyiyaoAddtionalReward()
          if(resData.status==200){
           this.$refs['MoneyNoTextLayer'].showModalFn(resData.data.reward)
          }else{
            this.$layer.msg(resData.message)
          }
        }catch (e) {

        }

      }else{
        this.kaihongbaoLayer = true
        this.flag = 'ProgressModal'
      }
    },
    // 关闭额外奖金弹框
    closeProgressModal(){
      this.kaihongbaoLayer = false
      this.flag = 'loading'
    },
    // 选择金额切换事件
    selectPricFn(index) {
      this.xiangjinPrice.forEach((item,num) => {
        item.checked = false
        if(index === num) {
          item.checked = true
        }
      })
    },
    //倒计时结束
    endTimeFn(){
      this.activityEndLayer = true
      this.$store.dispatch('yaoyiyaoUserInfo')
    },
    // #Region 以下是app的回调相关方法
    //微信提现成功返回
    OnVxChatWithdrawalSuccess(){

    },
    //微信提现失败返回
    OnVxChatWithdrawalFail(){

    },
    // 关闭广告
    onAdDismiss(params) {
      console.log('调用了关闭广告：'+params)
      if(this.appParms.mPlacementId=='p638ee4cd28b88'){
        console.log('关闭摇一摇广告')
        this.$refs['MoneyNoTextLayer'].showModalFn()
      }
    },
    // 点击广告
    onAdClicked(params) {
      console.log('调用了点击广告：'+params)
    },
    // 加载广告失败
    onAdLoadFail(params) {
      console.log('加载广告失败：'+params)
      this.onAdDismiss(params)
    },
    // 加载广告成功
    onAdLoadSuccess(params) {
      console.log('加载广告成功：'+params)
    },
    // 加载广告超时
    onAdLoadTimeout(params) {
      console.log('加载广告超时：'+params)
      this.onAdDismiss(params)
    },
    // 查看广告
    onAdShow(params) {
      console.log('查看广告：'+params)
    },
    // 奖励激励
    onRewardVerify(params) {
      console.log('调用了奖励激励：'+params)

    }
    // #End Region

  }
}
